import IMG1 from '../../images/fashion-woman-1.jpg'
import IMG2 from '../../images/fashion-woman-2.jpg'

const data = [
    {
        style: "women",
        content: "Personalized fall finds, thanks to your Stylist.",
        image1: {IMG1},
        image2: {IMG2}
    },
    {
        style: "men",
        content: "Men's content",
        image1: {IMG1},
        image2: {IMG2}

    },
    {
        style: "kids",
        content: "Kid's content.",
        image1: {IMG1},
        image2: {IMG2}
    }
]

export default data;
